import React, { Fragment, Component } from 'react';

class NotLoaded extends Component {

  componentDidMount() {
    this.setState({
      hasLoaded: true
    })
  }

  render() {
    return (
      <Fragment>
        <h2>Loading...</h2>
        <button onClick={ this.props.onClick }></button>
      </Fragment>
    );
  }
}

export default NotLoaded;
